import * as React from "react";
import { styled, createTheme, ThemeProvider } from "@mui/material/styles";

import Box from "@mui/material/Box";

import Toolbar from "@mui/material/Toolbar";

import Typography from "@mui/material/Typography";
import  Divider  from "@mui/material/Divider";
import Container from "@mui/material/Container";
import Grid from "@mui/material/Grid";
import Paper from "@mui/material/Paper";

import Header from "../../component/header.js";
import CustomizedBreadcrumbs from "../../component/breadcrumbs.js";

import Sidebar from "../../component/sidebar.js";
import Steppers from "../../component/stepper.js";

import Personinfo from "../../component/personinfo.js";
var stepper = 1;
function Space() {
  return (
    <Toolbar
      sx={{
        display: "flex",
        alignItems: "center",
        justifyContent: "flex-end",
        px: [2],
      }}
    ></Toolbar>
  );
}

// TODO remove, this demo shouldn't need to reset the theme.
const defaultTheme = createTheme();

export default function Casepersoninfo() {
  const [open, setOpen] = React.useState(true);
  const toggleDrawer = () => {
    setOpen(!open);
  };

  return (
    <Box component="div" sx={{ display: "flex" }}>
      <Header />
      <Sidebar />
      <Box
        component="main"
        sx={{
          backgroundColor: (theme) =>
            theme.palette.mode === "light"
              ? theme.palette.grey[100]
              : theme.palette.grey[900],
          flexGrow: 2,
          height: "100vh",
          overflow: "auto",
        }}
      >
        <Space />
        <Space />

        <Container maxWidth="lg" sx={{ mt: 4, mb: 4, flexGrow: 2 }}>

          <Grid container spacing={3}>
            <Grid item xs={12}>
              <Paper
                sx={{ p: 2, display: "flex", flexDirection: "column" }}
              >
                <Steppers data={stepper}/>
                <Divider />

               <Personinfo/>

              </Paper>
            </Grid>
          </Grid>

        </Container>
      </Box>
    </Box>
  );
}
